import React from 'react'
import { getCols, } from '../utils/utils'

import Image from './Image.jsx'

class Header extends React.PureComponent {
    render = () => {
        return (
            <header className="header">
                <a href="" target="_blank" rel="noopener">Shop</a>
                <a href="" target="_blank" rel="noopener">About</a>
                <div className="logo" />

                <style jsx>{`
                    .header {
                        display: flex;
                        justify-content: flex-end;
                        align-items: center;

                        color: white;
                        mix-blend-mode: multiply;

                        width: 100%;
                        height: 100%;

                        z-index: 3;

                        padding: ${ getCols(1) }vw;
                    }

                    a {
                        font-weight: 600;
                    }

                    .logo {
                        background-image: url('/static/images/logo.jpg');
                        width: ${ getCols(1.5) }vw;
                        height: ${ getCols(1.5) }vw;
                    }
                `}</style>
            </header>
        )
    }
}

export default Header
